class SystemContainer extends Nette\DI\Container
{

	public $classes = array(
		'nette\\object' => FALSE, //: cacheJournal, cacheStorage, httpRequestFactory, httpRequest, httpResponse, httpContext, session, user, application, router, mailer, authenticator, model, container,
